// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconAlertSvg, IconInformationSvg, IconLegendSvg } from '../../content/images/svg';

export class NavIcons extends Component {

    constructor(props) {
        super();

        this.state = {
            show: false
        }

        showModal = () => {
            this.setState({
                show: true
            });
        };

        hideModal = () => {
            this.setState({
                show: false
            });
        };

    }

    render() {
        return (
            <div className="nav-icons">
                <div>
                    <button type="button" onClick={this.showModal}>
                        <span>
                            <IconInformationSvg />
                        </span>
                    </button>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconInformationSvg />
                        </span>
                    </NavLink>
                </div>
                <div>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconAlertSvg />
                        </span>
                    </NavLink>
                </div>
                <div>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconLegendSvg className="nav-icons__button-icon" />
                        </span>
                    </NavLink>
                </div>
            </div>
        );
    }
}
